import React, { useEffect } from 'react';

function CreateContact(props){
  return(
  <div>
      <h2>{props.name}</h2>
      <button id = "dl" class = "button2">Delete</button> <br/><br/>
      name: <input id = "type"/>
      number: <input id = "number" />
      <button id = "add" class = "button1">Add</button>
      <Table /> 

  </div>
  );
}

function Table() {
  return (
    <div id="new_contact">
      <table>
        <tr>
          <th><h3 id="create_name">Type</h3></th>
          <th><h3 id="number">Number</h3></th>
        </tr>
        <tr>
          <th>office</th>
          <th>9123</th>
          <th><button id = "dl3">delete</button></th>
        </tr>


      </table>

    </div>
  );
}

export default Table;
